import React, { Component } from 'react';
import Koockie from './cookie.jpeg'



class Cookie extends Component {
  constructor() {
    super()
    this.state = {
      clicked : 0
    }
  }

  toggleClicks = () => {}

  render() {
    return (
      <div>
        <h1>You have eaten this {this.state.clicked}</h1>
        <img className="cookie" src={Koockie} alt=""/>
      </div>
    );
  }
}

export default Cookie;
